import Alert from 'react-bootstrap/Alert'
const mongoose = require('mongoose')

export default function CustomComponent(el) {
    var component = mongoose.model('CustomComponent');

    component.find({name: el.name}, function (err, comp) {
        if(err) {
            return (
                <Alert variant="danger">Component Not Found</Alert>
            );
        } else {
            return <Alert variant="success">Component Found</Alert>; //comp[0];
        }
    });
